// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./interface/IUniswapV2Router02.sol";
import "./interface/ITradeRouter.sol";
import "./interface/IERC20.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";

contract BuyBackBurn is Initializable, OwnableUpgradeable {
    address constant BURN = 0x000000000000000000000000000000000000dEaD;
    address public tradeRouter;
    address public sfmTokenAddress;
    uint256 public threshold;

    event ChangeSFMAddress(address token);
    event ChangeThreshold(uint256 amount);
    event ChangeRouter(address router);

    function initialize(
        uint256 _threshold,
        address _tradeRouter,
        address _sfmToken
    ) external initializer {
        threshold = _threshold;
        tradeRouter = _tradeRouter;
        sfmTokenAddress = _sfmToken;
        __Ownable_init();
    }

    receive() external payable {
        buyBackAndBurn();
    }

    function buyBackAndBurn() public payable {
        uint256 total = address(this).balance;
        if (total >= threshold && threshold > 0) {
            uint256 times = total / threshold;
            uint256 bnbSwapAmount = threshold * times;
            _swap(bnbSwapAmount);
            _burn();
        }
    }

    function _swap(uint256 tokenAmount) private {
        address router = ITradeRouter(tradeRouter).swapRouter();
        address[] memory path = new address[](2);
        path[1] = sfmTokenAddress;
        path[0] = IUniswapV2Router02(router).WETH();
        uint256[] memory amounts = IUniswapV2Router02(router).getAmountsOut(tokenAmount, path);
        ITradeRouter.Trade memory newTrade = ITradeRouter.Trade(
            {
                amountIn: tokenAmount,
                amountOut: amounts[1],
                path: path,
                to: payable(address(this)),
                deadline: block.timestamp
            }
        );
        // make the swap
        ITradeRouter(tradeRouter).swapExactETHForTokensWithFeeAmount{ value: tokenAmount }(
            newTrade,
            0
        );
    }

    function _burn() private {
        uint256 balance = IERC20(sfmTokenAddress).balanceOf(address(this));
        IERC20(sfmTokenAddress).transfer(BURN, balance);
    }

    function changeSFMToken(address _token) public onlyOwner {
        sfmTokenAddress = _token;
        emit ChangeSFMAddress(_token);
    }

    function changeRouter(address _tradeRouter) public onlyOwner {
        tradeRouter = _tradeRouter;
        emit ChangeRouter(_tradeRouter);
    }

    function changeThreshold(uint256 _threshold) public onlyOwner {
        threshold = _threshold;
        emit ChangeThreshold(_threshold);
    }
}

contracts/interface/IUniswapV2Router02.s.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface IUniswapV2Router01 {
    function factory() external pure returns (address);

    function WETH() external pure returns (address);

    function addLiquidity(
        address tokenA,
        address tokenB,
        uint256 amountADesired,
        uint256 amountBDesired,
        uint256 amountAMin,
        uint256 amountBMin,
        address to,
        uint256 deadline
    )
        external
        returns (
            uint256 amountA,
            uint256 amountB,
            uint256 liquidity
        );

    function addLiquidityETH(
        address token,
        uint256 amountTokenDesired,
        uint256 amountTokenMin,
        uint256 amountETHMin,
        address to,
        uint256 deadline
    )
        external
        payable
        returns (
            uint256 amountToken,
            uint256 amountETH,
            uint256 liquidity
        );

    function removeLiquidity(
        address tokenA,
        address tokenB,
        uint256 liquidity,
        uint256 amountAMin,
        uint256 amountBMin,
        address to,
        uint256 deadline
    ) external returns (uint256 amountA, uint256 amountB);

    function removeLiquidityETH(
        address token,
        uint256 liquidity,
        uint256 amountTokenMin,
        uint256 amountETHMin,
        address to,
        uint256 deadline
    ) external returns (uint256 amountToken, uint256 amountETH);

    function removeLiquidityWithPermit(
        address tokenA,
        address tokenB,
        uint256 liquidity,
        uint256 amountAMin,
        uint256 amountBMin,
        address to,
        uint256 deadline,
        bool approveMax,
        uint8 v,
        bytes32 r,
        bytes32 s
    ) external returns (uint256 amountA, uint256 amountB);

    function removeLiquidityETHWithPermit(
        address token,
        uint256 liquidity,
        uint256 amountTokenMin,
        uint256 amountETHMin,
        address to,
        uint256 deadline,
        bool approveMax,
        uint8 v,
        bytes32 r,
        bytes32 s
    ) external returns (uint256 amountToken, uint256 amountETH);

    function swapExactTokensForTokens(
        uint256 amountIn,
        uint256 amountOutMin,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external returns (uint256[] memory amounts);

    function swapTokensForExactTokens(
        uint256 amountOut,
        uint256 amountInMax,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external returns (uint256[] memory amounts);

    function swapExactETHForTokens(
        uint256 amountOutMin,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external payable returns (uint256[] memory amounts);

    function swapTokensForExactETH(
        uint256 amountOut,
        uint256 amountInMax,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external returns (uint256[] memory amounts);

    function swapExactTokensForETH(
        uint256 amountIn,
        uint256 amountOutMin,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external returns (uint256[] memory amounts);

    function swapETHForExactTokens(
        uint256 amountOut,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external payable returns (uint256[] memory amounts);

    function quote(
        uint256 amountA,
        uint256 reserveA,
        uint256 reserveB
    ) external pure returns (uint256 amountB);

    function getAmountOut(
        uint256 amountIn,
        uint256 reserveIn,
        uint256 reserveOut
    ) external pure returns (uint256 amountOut);

    function getAmountIn(
        uint256 amountOut,
        uint256 reserveIn,
        uint256 reserveOut
    ) external pure returns (uint256 amountIn);

    function getAmountsOut(uint256 amountIn, address[] calldata path) external view returns (uint256[] memory amounts);

    function getAmountsIn(uint256 amountOut, address[] calldata path) external view returns (uint256[] memory amounts);
}

interface IUniswapV2Router02 is IUniswapV2Router01 {
    function removeLiquidityETHSupportingFeeOnTransferTokens(
        address token,
        uint256 liquidity,
        uint256 amountTokenMin,
        uint256 amountETHMin,
        address to,
        uint256 deadline
    ) external returns (uint256 amountETH);

    function removeLiquidityETHWithPermitSupportingFeeOnTransferTokens(
        address token,
        uint256 liquidity,
        uint256 amountTokenMin,
        uint256 amountETHMin,
        address to,
        uint256 deadline,
        bool approveMax,
        uint8 v,
        bytes32 r,
        bytes32 s
    ) external returns (uint256 amountETH);

    function swapExactTokensForTokensSupportingFeeOnTransferTokens(
        uint256 amountIn,
        uint256 amountOutMin,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external;

    function swapExactETHForTokensSupportingFeeOnTransferTokens(
        uint256 amountOutMin,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external payable;

    function swapExactTokensForETHSupportingFeeOnTransferTokens(
        uint256 amountIn,
        uint256 amountOutMin,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external;
}

